package com.xwc.open.easybatis.core.enums;import org.apache.ibatis.mapping.SqlCommandType;/** * 创建人：徐卫超 * 时间：2019/8/3 17:25 * 功能： * 备注： */public enum FillType {    /**     * 插入时会进行审计     */    INSERT(SqlCommandType.INSERT),    /**     * 更新时会进行审计     */    UPDATE(SqlCommandType.UPDATE);    private SqlCommandType sqlCommandType;    FillType(SqlCommandType sqlCommandType) {        this.sqlCommandType = sqlCommandType;    }    public SqlCommandType command() {        return sqlCommandType;    }}